export function csv2linedata(csv, lineType, X) {
  let type = []
  if (lineType !== undefined) {
    type = lineType
  } else {
    for (var prop in csv[0]) {
      type.push(prop)
    }
  }
  const lineData = []
  for (let i = 0; i < type.length; i += 1){
    lineData[i] = {}
    lineData[i].name = type[i]
    lineData[i].data = []
    if (X === undefined) {
      for (let n = 0; n < csv.length; n += 1)
        lineData[i].data.push([n, csv[n][type[i]]])
    } else {
      for (let n = 0; n < csv.length; n += 1)
        lineData[i].data.push([csv[n][X], csv[n][type[i]]])
    }
  }
  return lineData
}

export function findMinMax(data, axis) {
  const minMax = {}

  for (let i = 0; i < data.length; i += 1){
    for (let n = 0; n < axis.Y.length; n += 1){
      const num = data[i][axis.Y[n]]-0
      if (minMax.min === undefined) {
        minMax.min = num
      }
      if (minMax.max === undefined) {
        minMax.max = num
      }
      if (minMax.min > num) minMax.min = num
      if (minMax.max < num) minMax.max = num
    }
  }
  return minMax
}

export function data2linedata(data,axisY) {
  const lineData = []
  for (let n = 0; n < axisY.length; n += 1){
    const line = {}
    line.name = axisY[n]
    line.data = []
    for (let i = 0; i < data.length; i += 1){
      line.data.push(data[i][axisY[n]])
    }
    lineData.push(line)
  }
  return lineData
}

